description: tokens or symbols delist schedule
content:
  application/json:
    schema:
      type: array
      items:
        type: object
        properties:
          delistTime:
            type: integer
            format: int64
            example: 1686161202000
          crossMarginAssets:
            type: array
            items:
              type: string
              example: BTC
          isolatedMarginSymbols:
            type: array
            items:
              type: string
              example: BNBUSDT
